import { Button, DatePicker, Form, Input } from "antd";
import React from "react";

const PersonalDetailsForm = () => {
  return (
    <>
      <Form>
        <Form.Item
          label="First Name"
          name={"firstName"}
          rules={[
            {
              required: true,
              type: "text",
              message: "Please Enter First Name",
            },
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="Last Name"
          name={"lastName"}
          rules={[
            {
              required: true,
              type: "text",
              message: "Please Enter Last Name",
            },
          ]}
        >
          <Input />
        </Form.Item>
        <Form.Item
          label="Date of Birth"
          name={"DOB"}
          rules={[
            {
              required: true,
              type: "number",
              message: "Please Enter Date of Birth",
            },
          ]}
        >
          <DatePicker />
        </Form.Item>
        <Form.Item>
            <Button type="primary" htmlType="submit">Next</Button>
        </Form.Item>
      </Form>
    </>
  );
};

export default PersonalDetailsForm;
